  [],\n\t\"revision_timestamp\": \"2015-04-30T15:27:53.276688\",\n\t\"name\": \"bald-eagle-movements-distribution-and-abundance-on-the-northern-chesapeake-bay\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of this study was
  to monitor bald eagle movements and to locate bald eagle intensive use areas on
  the northern Chesapeake Bay. An important goal was to determine how eagle use of
  Aberdeen Proving Ground compared with eagle use of the rest of the northern Bay,
  and thus to begin to understand the relative importance of Aberdeen Proving Ground
  habitat. Additionally, information on activity patterns, habitat use, foraging success,
  and the effect of human development on eagle distribution and abundance was obtained
  in the course of achieving the primary objective, and is included in this report.\",\n\t\"license_title\":
